const request = require('supertest');
const session = require('./session')();
const { assert, expect } = require('chai');

module.exports = app => {
    describe('Product CRUD should be working', function() {
        const productSent = { 
            name: 'A chainsaw',
            short_description: 'Good for movie serial killers',
            long_description: 'Good for movie serial killers like Jason and Freddy Krueger',
            price: 335.55,
            group: 'tools',
            photos: [getProductImages().shift()]
        };

        const productSent2 = { 
            name: 'A hammer',
            short_description: 'Good for movie and comic books serial killers',
            long_description: 'Good for movie and comic books serial killers like Jason and Freddy Krueger',
            price: 512.85,
            group: 'Tools',
            photos: [getProductImages().pop()]
        };

        it("Create", done => {
            request(app)
                .post('/cms/product/')
                .send(productSent)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    request(app)
                        .post('/cms/product/')
                        .send(productSent)
                        .set('Accept', 'application/json')
                        .set('Auth-Token', session.user.token)
                        .expect(200)
                        .end(function(err, res) {
                            if (err) throw err;
                            done();
                        });
                });
        });

        it("Retrieve", done => {
            request(app)
                .get('/cms/product')
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const products = res.body;
                    expect(products).to.not.be.eql(undefined);
                    const product = products.reverse().pop();
                    expect(product).to.not.be.eql(null);
                    assert(product.name, productSent.name);
                    assert(product.short_description, productSent.short_description);
                    assert(product.long_description, productSent.long_description);
                    assert(product.group, productSent.group);
                    productSent.id = product.id;
                    done();
                });
        });

        it("Update", done => {
            productSent.name = productSent2.name;
            productSent.short_description = productSent2.short_description;
            productSent.long_description = productSent2.long_description;
            productSent.price = productSent2.price;
            productSent.group = productSent2.group;
            productSent.photos = productSent2.photos;
            request(app)
                .put(`/cms/product/${productSent.id}`)
                .send(productSent)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    done();
                });
        });

        it("Check update", done => {
            request(app)
                .get(`/cms/product/id/${productSent.id}`)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const product = res.body;
                    assert(product.name, productSent.name);
                    assert(product.short_description, productSent.short_description);
                    assert(product.long_description, productSent.long_description);
                    assert(product.group, productSent.group);
                    productSent.id = product.id;
                    done();
                });
        });

        it("Delete", done => {
            request(app)
                .delete(`/cms/product/${productSent.id}`)
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    done();
                });
        });

        it("Check deletion", done => {
            request(app)
                .get('/cms/product/')
                .set('Accept', 'application/json')
                .set('Auth-Token', session.user.token)
                .expect(200)
                .end(function(err, res) {
                    if (err) throw err;
                    const covers = res.body;
                    expect(covers.length).to.be.eql(1);
                    done();
                });
        });
    });
}

function getProductImages() {
    return [
        ``,
        ``
    ]
}